import os
import requests
from pathlib import Path
from urllib.parse import urljoin

# Define the base URL
base_url = "https://ftp.ensembl.org/pub/rapid-release/species/"

# Species information as a list of dictionaries
species_metadata = {}

# Function to create directories and download files
def download_files(species_info):
    for entry in species_info:
        species_name = entry['species'].replace(' ', '_')  # Replace spaces with underscores
        assembly_accession = entry['assembly_accession']
        geneset = entry['geneset']

        # Construct the URLs
        # Attempt to find the directory among 'braker', 'ensembl', 'refseq'
        found = False
        for geneset_dir in ['braker', 'ensembl', 'refseq']:
            peptide_url_test = f"{base_url}{species_name}/{assembly_accession}/" + geneset_dir + f"/geneset/{geneset}/{species_name}-{assembly_accession}-{geneset}-pep.fa.gz"
            xref_url_test = f"{base_url}{species_name}/{assembly_accession}/" + geneset_dir + f"/geneset/{geneset}/{species_name}-{assembly_accession}-{geneset}-xref.tsv.gz"
            if requests.head(peptide_url_test).status_code == 200 and requests.head(xref_url_test).status_code == 200:
                peptide_url = peptide_url_test
                xref_url = xref_url_test
                found = True
                break
        if not found:
            print(f'Failed to find files for {species_name} in any directory.')
            continue

        # Make the directory
        directory_path = Path.cwd() / species_name
        directory_path.mkdir(parents=True, exist_ok=True)

        # Download the peptide file
        peptide_response = requests.get(peptide_url)
        if peptide_response.status_code == 200:
            with open(directory_path / f"{species_name}-{assembly_accession}-{geneset}-pep.fa.gz", 'wb') as f:
                f.write(peptide_response.content)
            print(f"Downloaded {species_name} peptide file.")
        else:
            print(f"Failed to download {species_name} peptide file.")

        # Download the xref file
        xref_response = requests.get(xref_url)
        if xref_response.status_code == 200:
            with open(directory_path / f"{species_name}-{assembly_accession}-{geneset}-xref.tsv.gz", 'wb') as f:
                f.write(xref_response.content)
            print(f"Downloaded {species_name} xref file.")
        else:
            print(f"Failed to download {species_name} xref file.")


